import React from "react";

const Tip = ({ tipcars }) => {
  console.log("tipcars:", tipcars); // Log the entire tipcars array

  if (!Array.isArray(tipcars)) {
    return <div>No tips available</div>;
  }

  return (
    <div>
      {tipcars.map((tip, index) => (
        <div key={index}>
          <p>ID: {tip.id}</p>
          <p>Nametip: {tip.nametip}</p>
          <p>Active: {tip.active}</p>
        </div>
      ))}
    </div>
  );
};

export default Tip;
